import React from "react";
import Navbar from "../Common/navbar";
import Main from "../Common/main";
import Product from "../Common/products";

function HeroPage() {
  return (
    <>
      <Navbar />
      <Main />
      <Product />
    </>
  );
}

export default HeroPage;
